import logo from '../../logo.svg';
function Header() {
    const logotipo = <img src={logo} width="70px" />;

    return (
        <div className="row m-3">
            <div className="col">{logotipo}</div>
            <div className="col text-center fs-1 fw-bold mytitle">MyBook</div>
            <div className="col text-end">
                <ul className="nav">
                    <li className="nav-item">Item</li>
                    <li className="nav-item">Item</li>
                    <li className="nav-item">Item</li>
                </ul>
            </div>
        </div>
    );
}
export default Header;
